import React, { useState, useEffect } from "react";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Label } from "@/components/ui/label";
import { Card, CardContent, CardHeader, CardTitle } from "@/components/ui/card";

interface OneMapMinimapProps {
  width?: number;
  height?: number;
  defaultLocation?: string;
  className?: string;
  onRef?: (ref: any) => void;
  externalLocation?: string;
}

export const OneMapMinimap: React.FC<OneMapMinimapProps> = ({
  width = 500,
  height = 350,
  defaultLocation = "Singapore",
  className = "",
  onRef,
  externalLocation,
}) => {
  const [location, setLocation] = useState(defaultLocation);
  const [mapSrc, setMapSrc] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  // Generate OneMap minimap URL
  const generateMapUrl = (searchLocation: string, mapWidth: number, mapHeight: number) => {
    // Using OneMap's minimap service with iframe embedding
    const baseUrl = "https://www.onemap.gov.sg/minimap/minimap.html";
    const params = new URLSearchParams({
      width: mapWidth.toString(),
      height: mapHeight.toString(),
      center: searchLocation,
      zoom: "16", // Good zoom level for property viewing
      style: "Default",
      showPopup: "true",
      showScale: "true",
      showMinimap: "false"
    });

    return `${baseUrl}?${params.toString()}`;
  };

  // Initialize map on component mount
  useEffect(() => {
    const initialUrl = generateMapUrl(location, width, height);
    setMapSrc(initialUrl);
  }, [location, width, height]);

  // Update location from external source
  useEffect(() => {
    if (externalLocation && externalLocation.trim()) {
      setLocation(externalLocation);
    }
  }, [externalLocation]);

  // Expose update function via ref
  useEffect(() => {
    if (onRef) {
      onRef({
        updateLocation: (newLocation: string) => {
          setLocation(newLocation);
        }
      });
    }
  }, [onRef]);

  const handleLocationSearch = () => {
    if (!location.trim()) return;

    setIsLoading(true);
    const newMapUrl = generateMapUrl(location, width, height);
    setMapSrc(newMapUrl);

    // Simulate loading time for better UX
    setTimeout(() => {
      setIsLoading(false);
    }, 1000);
  };

  const handleKeyPress = (e: React.KeyboardEvent) => {
    if (e.key === 'Enter') {
      handleLocationSearch();
    }
  };

  return (
    <Card className={`w-full ${className}`}>
      <CardHeader>
        <CardTitle className="text-lg font-semibold">Location Map</CardTitle>
        <div className="flex gap-2">
          <div className="flex-1">
            <Label htmlFor="location-search" className="text-sm font-medium">
              Search Location
            </Label>
            <Input
              id="location-search"
              data-testid="input-location-search"
              type="text"
              placeholder="Enter address, postal code, or building name"
              value={location}
              onChange={(e) => setLocation(e.target.value)}
              onKeyPress={handleKeyPress}
              className="mt-1"
            />
          </div>
          <div className="flex items-end">
            <Button
              data-testid="button-search-location"
              onClick={handleLocationSearch}
              disabled={isLoading || !location.trim()}
              className="bg-[#181f28] hover:bg-[#2a3441]"
            >
              {isLoading ? "Searching..." : "Search"}
            </Button>
          </div>
        </div>
      </CardHeader>
      <CardContent>
        <div 
          className="relative w-full rounded-lg overflow-hidden border border-gray-200"
          style={{ width: `${width}px`, height: `${height}px` }}
        >
          {isLoading && (
            <div className="absolute inset-0 bg-gray-100 flex items-center justify-center z-10">
              <div className="text-center">
                <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-[#181f28] mx-auto mb-2"></div>
                <p className="text-sm text-gray-600">Loading map...</p>
              </div>
            </div>
          )}

          <iframe
            data-testid="iframe-onemap"
            src={mapSrc}
            width="100%"
            height="100%"
            frameBorder="0"
            scrolling="no"
            title={`OneMap for ${location}`}
            className="w-full h-full"
            onLoad={() => setIsLoading(false)}
          />
        </div>

        <div className="mt-3 text-xs text-gray-500 flex items-center justify-between">
          <span>Powered by OneMap Singapore</span>
          <a 
            href="https://www.onemap.gov.sg" 
            target="_blank" 
            rel="noopener noreferrer"
            className="text-blue-600 hover:underline"
          >
            OneMap.gov.sg
          </a>
        </div>
      </CardContent>
    </Card>
  );
};
